import React, { useState } from 'react'
import { Text, View, Button, StyleSheet, TextInput, TouchableOpacity, Image } from 'react-native'
import GraphqlService from '../../functions/axios'
const service = new GraphqlService()

const MainPage = async ({ navigation }) => {
    function showAllUsers() {
        let usersList = service.getAllUsers()
        console.log(usersList)
    }
    return (
        <View>
            <Text>PATO NO TUCUPI</Text>
            <Button onPress={() => showAllUsers()}></Button>
        </View>

    )
}

export default MainPage
